Impact! A Horizon Guide to Car Crashes
Dallas Campbell looks back over fifty years to chart the key scientific breakthroughs that have transformed road safety and saved millions of lives.
In the 1950s, up to 8,000 people died every year on the roads in the UK, a horrific figure. This has now fallen to around 2,000 a year - still a terrible toll but a vast improvement, particularly given the huge increase in the number of cars on the road. However, road safety has not all been about innovative engineering and groundbreaking discoveries. Scientists have also had to act as campaigners, persuading car manufacturers to install their safety devices and urging the public to use them.

